import styled from "styled-components";

const FifthDescription = () => {
    return (
        <Container>
            <Title>MENU</Title>
        </Container>
    );
}
export default FifthDescription;

const Container = styled.div`
    border-style: solid;
`;
const Title = styled.p`
    margin: 0 auto;
`;
